from sklearn.mixture import GaussianMixture
from sklearn.metrics import roc_curve, auc
import numpy as np

# Train GMM with non-fall data
def train_gmm(non_fall_data):
    gmm = GaussianMixture(n_components=2)  # Example, adjust components as needed
    gmm.fit(non_fall_data)
    return gmm

# Detect anomalies using trained GMM
def detect_anomalies(gmm, data):
    if len(data.shape) == 1:
        data = data.reshape(1, -1)
    log_probs = gmm.score_samples(data)
    return log_probs

# Calculate ROC curve and AUC-ROC
def evaluate_anomalies(non_fall_log_probs, fall_log_probs):
    # Combining the log probabilities
    labels = [0] * len(non_fall_log_probs) + [1] * len(fall_log_probs)
    all_log_probs = np.concatenate([non_fall_log_probs, fall_log_probs])

    fpr, tpr, thresholds = roc_curve(labels, -all_log_probs)  # Minus sign as we want to maximize likelihood
    roc_auc = auc(fpr, tpr)

    # Youden's Index
    youden_index = tpr - fpr
    best_threshold = thresholds[np.argmax(youden_index)]

    predictions = (all_log_probs <= -best_threshold).astype(int)
    print("  ")
    print(predictions,len(predictions))
    print(labels,len(labels))
    print("  ")

    true_positives = 0
    true_negatives= 0
    false_positives = 0
    false_negatives = 0

    for i in range(len(predictions)):
        print(predictions[i],"  ",labels[i])
        if(predictions[i] == labels[i] == 1):
            true_positives +=1
        elif(predictions[i] == labels[i] == 0):
            true_negatives +=1
        elif(predictions[i] == 0 and labels[i] == 1):
            false_negatives +=1
        elif(predictions[i] == 1 and labels[i] == 0):
            false_positives +=1


    # Confusion matrix
    # true_positives = np.sum((predictions == 1) & (labels == 1))
    # true_negatives = np.sum((predictions == 0) & (labels == 0))
    # false_positives = np.sum((predictions == 1) & (labels == 0))
    # false_negatives = np.sum((predictions == 0) & (labels == 1))

    print("TP : ",true_positives," TN : ",true_negatives)
    print("FP : ",false_positives," FN : ",false_negatives)
    # Sensitivity (True Positive Rate)
    sensitivity = true_positives / (true_positives + false_negatives)

    # Specificity (True Negative Rate)
    specificity = true_negatives / (true_negatives + false_positives)

    # Accuracy
    accuracy = (true_positives + true_negatives) / len(labels)

    return fpr, tpr, roc_auc, best_threshold,sensitivity,specificity,accuracy


